INSERT INTO `abouts` (`id`, `title`, `title_ar`, `about`, `about_ar`, `image`, `created_at`, `updated_at`) VALUES
(1, 'Who are we?', '', 'Bubblzz offers a wide range bath and body care products. Bubblzz was established by two chemists in 2014 using simple Chemistry to reinforce the use of wholesome and natural ingredients to nourish the skin from inside out. Our products are made from scratch, formulated from organic & essential oils, and are free from harsh chemicals. \r\n\r\nOur line includes soaps, bathbombs, lip balms, lip scrubs, deodorants, face and body scrubs, shower gels, lotions, facial cleaner,  and hair care products.\r\n\r\nOur philosophy is what you put on your body is just as important as what you put inside your body!', '', 'noImage.png', '2018-12-23 02:41:48', '2019-08-07 11:15:03');
