(151, 'Flax Seed Cream Gel', 'كريم الشعر ببذر الكتان', '', '', 'This versatile cream gel blends flax seed oil, argan oil and aloe vera gel to provide deep moisture, define curl pattern and leave coily and curly styles smooth and bouncy with  soft hold.', '', 'Shampoo and condition your hair as usual. Dry your hair with a cotton towel. Apply flax seed cream gel to your hair. Finger comb your curls to distribute the gel and curl your hair by scrunching. Blow dry or diffuse curls to set your hair. Avoid combs or brushes when your hair dries. Wear a silk bonnet at night to preserve curls.', 'Water(aqua), flax seed oil, argan oil, aloe vera gel, glycerin, xanthan gum, fragrance.', '180', '0', 0, 2, 2, 0, 0, 0, 0, '', '5e8ee45f3241b5.28669726.png', NULL, 'flax-seed-cream-gel-151', '2020-04-08 18:47:58', '2020-04-09 07:01:19'),
